import './login.css';
import volumefy from "./volumefy.png";
import Main from './Main'

// LOGI PAGE
const Login = () => {
  return (
    <div className="Login">
      {/* Name and logo */}
        <div>
            <img src={volumefy} className="logo"/>
            <h1 className="h1text"> VOLUMEFY</h1><hr/>
        </div>
        {/* Inputs */}
        <h2>Welcome back!</h2>
        <h2>User Name</h2>
        <input className="input" type="text" />
        <h2>Password</h2>
        <input className="input" type="password"/><br/><br/>
        <button><Link to="/Main">SIGN IN</Link></button>
    </div>
  );
}

export default Login;
